    ja: 'この研究にはインコグニート/プライベートウィンドウが必要であり、このウィンドウはそうではありません。これを修正することができます。Safari以外のどのブラウザでも、インコグニートウィンドウを開き、そのウィンドウで研究リンクを実行してください。\n\n説明：主要なブラウザはすべて、インコグニートモードでウィンドウを開くことができますが、名前は異なります。例えば、「インコグニート」、「InPrivate」、「プライベートブラウジング」、「プライベートウィンドウ」などです。Safari以外のすべてのブラウザは、ウェブページがインコグニートモードであるかどうかを報告します。Safariは常に「いいえ」と表示されます。インコグニートモードは通常、プライバシー保護のために使用されます。EasyEyesは、サウンドキャリブレーションに必要なEasyEyes Firebaseライブラリへのアクセスを容易にするために使用しています。',
    kn: 'Loading...',
