    'en-UK': 'Loading...',
    fi: 'Loading...',
    fr: "Cette étude nécessite une fenêtre en mode incognito/privé, et cette fenêtre ne l'est pas. Vous pouvez corriger cela. En utilisant n'importe quel navigateur autre que Safari, ouvrez une fenêtre en mode incognito et exécutez le lien de l'étude dans cette fenêtre.\n\nEXPLICATION : Tous les principaux navigateurs vous permettent d'ouvrir une fenêtre en mode incognito, bien que le nom varie, par exemple « Incognito », « InPrivate », « Navigation privée » ou « Fenêtre privée ». Tous les navigateurs sauf Safari indiquent si la page web est en mode incognito. Safari indique toujours non. Le mode incognito est généralement utilisé pour la confidentialité. EasyEyes l'utilise pour faciliter l'accès à la bibliothèque Firebase de EasyEyes, nécessaire pour la calibration du son.",
    de: '"Diese Studie benötigt ein Inkognito-/Privatfenster, und dieses Fenster ist es nicht. Du kannst das beheben. Öffne mit einem beliebigen Browser außer Safari ein Inkognito-Fenster und führe den Studienlink in diesem Fenster aus.\n\nERKLÄRUNG: Alle gängigen Browser ermöglichen das Öffnen eines Fensters im Inkognito-Modus, obwohl der Name variieren kann, z.B. "Inkognito", "InPrivate", "Privates Browsen" oder "Privates Fenster". Alle Browser außer Safari geben an, ob die Webseite im Inkognito-Modus ist. Safari sagt immer nein. Der Inkognito-Modus wird in der Regel für Datenschutz verwendet. EasyEyes verwendet ihn, um den Zugriff auf die EasyEyes Firebase-Bibliothek zu erleichtern, die für die Klangkalibrierung benötigt wird."',
    el: 'Loading...',
