    sr: 'Ova studija zahteva inkognito/privatni prozor, a ovaj prozor to nije. Možete to popraviti. Koristeći bilo koji pregledač osim Safarija, otvorite inkognito prozor i pokrenite link studije u tom prozoru.\n\nOBJAŠNJENJE: Svi glavni pregledači vam omogućavaju otvaranje prozora u inkognito režimu, iako se naziv može razlikovati, na primer "Incognito", "InPrivate", "Private Browsing" ili "Private Window". Svi pregledači osim Safarija prijavljuju da li je web stranica u inkognito režimu. Safari uvek kaže ne. Inkognito režim se obično koristi radi privatnosti. EasyEyes ga koristi radi olakšanog pristupa EasyEyes Firebase biblioteci, koja je potrebna za kalibraciju zvuka.\n',
    es: 'Este estudio necesita una ventana en modo incógnito/privado, y esta ventana no lo está. Puedes solucionarlo. Usando cualquier navegador excepto Safari, abre una ventana en modo incógnito y ejecuta el enlace del estudio en esa ventana.\n\nEXPLICACIÓN: Todos los principales navegadores te permiten abrir una ventana en modo incógnito, aunque el nombre varía, por ejemplo, “Incógnito”, “InPrivate”, “Navegación Privada” o “Ventana Privada”. Todos los navegadores excepto Safari informan si la página web está en modo incógnito. Safari siempre dice que no. El modo incógnito se utiliza típicamente para la privacidad. EasyEyes lo usa para facilitar el acceso a la biblioteca Firebase de EasyEyes, que es necesaria para la calibración del sonido.',
    su: 'Loading...',
    sw: '"Utafiti huu unahitaji dirisha la siri/incognito, na dirisha hili haliko. Unaweza kusahihisha hili. Kutumia kivinjari kingine isipokuwa Safari, fungua dirisha la siri, na endesha kiungo cha utafiti katika dirisha hilo.\n\nMAELEZO: Vivinjari vyote vikuu huruhusu kufungua dirisha katika hali ya siri, ingawa jina linatofautiana, kama vile "Incognito", "InPrivate", "Private Browsing", au "Private Window". Vivinjari vyote isipokuwa Safari hutoa ripoti ikiwa ukurasa wa wavuti uko katika hali ya siri. Safari daima inasema la. Hali ya siri kawaida hutumiwa kwa faragha. EasyEyes inaitumia kufanya iwe rahisi kupata maktaba ya EasyEyes Firebase, ambayo inahitajika kwa kalibrering ya sauti."',
    sv: '"Denna studie behöver ett inkognito/privat fönster, och det här fönstret är det inte. Du kan fixa detta. Använd vilken webbläsare som helst förutom Safari, öppna ett inkognito-fönster och kör studielänken i det fönstret.\n\nFÖRKLARING: Alla stora webbläsare tillåter dig att öppna ett fönster i inkognitoläge, även om namnet varierar, t.ex. "Incognito", "InPrivate", "Privat surfning" eller "Privat fönster". Alla webbläsare utom Safari rapporterar om webbsidan är i inkognitoläge. Safari säger alltid nej. Inkognitoläge används vanligtvis för integritet. EasyEyes använder det för att underlätta åtkomst till EasyEyes Firebase-bibliotek, som behövs för ljudkalibrering."',
    tl: 'Loading...',
    tr: 'Loading...',
    ur: '"اس مطالعے کو ایک ناشناختہ / نجی ونڈو کی ضرورت ہوتی ہے اور یہ ونڈو نہیں ہے۔ آپ اس کو درست کر سکتے ہیں۔ سفاری کے علاوہ کسی بھی براؤزر کا استعمال کرتے ہوئے، ایک ناشناختہ ونڈو کھولیں اور اس ونڈو میں مطالعے کا لنک چلائیں.\n\nوضاحت: تمام بڑے براؤزرز آپ کو ناشناختہ موڈ میں ایک ونڈو کھولنے کی اجازت دیتے ہیں، حالانکہ نام مختلف ہوتا ہے، مثلاً "ناشناختہ"، "ان پرائیویٹ"، "پرائیویٹ براؤزنگ" یا "پرائیویٹ ونڈو". سب براؤزرز کے علاوہ سفاری رپورٹ کرتے ہیں کہ ویب پیج ناشناختہ موڈ میں ہے یا نہیں۔ سفاری ہمیشہ نہیں کہتا ہے۔ ناشناختہ موڈ عموماً خصوصیت کے لئے استعمال ہوتا ہے۔ EasyEyes اسے آسانی سے رسائی حاصل کرنے کے لئے استعمال کرتا ہے، جو آواز کی کیلیبریشن کے لئے ضروری ہوتا ہے۔"',
