    ko: '설명에 명시된 바와 같이 이 연구는 ooo와 양립할 수 없습니다. CPU 코어가 222개 이상인 DDD가 필요합니다.',
    lt: 'Kaip teigiama jo aprašyme, šis tyrimas nesuderinamas su ooo. Tam reikia DDD su mažiausiai 222 procesoriaus branduoliais',
