    it: '\nIL TUO telefono Motorola. Abbiamo bisogno di dettagli che specificano il suo modello. Vai su Impostazioni > Informazioni sul telefono (precedentemente "Informazioni sul dispositivo"). Il NOME del modello e il (NUMERO) sono combinati in una riga chiamata "Modello". Copia il nome prima delle parentesi in Nome modello qui sotto. Copia le lettere e i numeri all\'interno delle parentesi in Numero modello qui sotto.\n',
