    ar: '\nجهاز الآيباد الخاص بك. نحتاج إلى تفاصيل تحدد طرازه. اذهب إلى الإعدادات > عام > حول. انسخ "اسم الطراز" في الحقل أدناه. ثم انقر على "رقم الطراز" لكشف الرقم "A" المخفي: حرف "A" يليه أربعة أرقام. اكتب ذلك في الحقل أدناه.\n',
