    'zh-HK': 'Loading...',
    hr: 'Loading...',
    cs: '"VÁŠ iPad. Potřebujeme podrobnosti specifikující jeho model. Přejděte do Nastavení > Obecné > O zařízení. Zkopírujte "Název modelu" do pole níže. Poté klepněte na "Číslo modelu", abyste odhalili skryté "A" číslo: "A" následované čtyřmi číslicemi. Zadejte to do pole níže."',
    da: '"DIN iPad. Vi har brug for detaljer, der specificerer dens model. Gå til Indstillinger > Generelt > Om. Kopier "Modelnavn" til feltet nedenfor. Tryk derefter på "Modelnummer" for at afsløre det skjulte "A" nummer: et "A" efterfulgt af fire cifre. Indtast det i feltet nedenfor."',
    nl: 'Loading...',
    'en-UK':
      '"YOUR iPad. We need details specifying its model. Go to Settings > General > About. Copy the "Model Name" to the field below. Then tap the "Model Number" to reveal the hidden "A" number: an "A" followed by four digits. Type that into the field below."',
    fi: '"OMA iPadisi. Tarvitsemme tarkempia tietoja sen mallista. Siirry kohtaan Asetukset > Yleiset > Tietoja. Kopioi "Mallin nimi" alla olevaan kenttään. Napauta sitten "Mallinumero" paljastaaksesi piilotetun "A" -numeron: "A" seurattuna neljällä numerolla. Kirjoita se kenttään alla."',
    fr: '\nVOTRE iPad. Nous avons besoin de détails spécifiant son modèle. Allez dans Réglages > Général > À propos. Copiez le "Nom du modèle" dans le champ ci-dessous. Ensuite, appuyez sur le "Numéro de modèle" pour révéler le numéro "A" caché : un "A" suivi de quatre chiffres. Tapez cela dans le champ ci-dessous.',
