    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: '"IL TUO iPad. Abbiamo bisogno di dettagli che specificano il suo modello. Vai su Impostazioni > Generale > Info. Copia il "Nome Modello" nel campo sottostante. Poi tocca il "Numero Modello" per rivelare il numero "A" nascosto: una "A" seguita da quattro cifre. Digita questo nel campo sottostante."',
    ja: '「あなたのiPadです。モデルを特定するための詳細が必要です。設定>一般>情報に移動してください。"モデル名"を以下のフィールドにコピーしてください。次に、"モデル番号"をタップして隠された"A"の後に続く4桁の数字を表示してください。それを以下のフィールドに入力してください。」',
    kn: 'Loading...',
    ko: '"당신의 iPad입니다. 모델을 구체적으로 지정해야 합니다. 설정 > 일반 > 정보로 이동하세요. "모델 이름"을 아래 필드에 복사하세요. 그런 다음 "모델 번호"를 탭하여 숨겨진 "A" 번호를 확인하세요. "A" 다음에 네 자리 숫자가 따라옵니다. 그 숫자를 아래 필드에 입력하세요."',
    lt: 'Loading...',
    ms: '"iPad ANDA. Kami memerlukan butiran yang menentukan modelnya. Pergi ke Tetapan > Am > Mengenai. Salin "Nama Model" ke dalam medan di bawah. Kemudian ketik "Nombor Model" untuk mendedahkan nombor "A" yang tersembunyi: satu "A" diikuti oleh empat digit. Taipkan itu ke dalam medan di bawah."',
    ml: 'Loading...',
    no: '"DIN iPad. Vi trenger detaljer som spesifiserer modellen. Gå til Innstillinger > Generelt > Om. Kopier "Modellnavn" til feltet nedenfor. Trykk deretter på "Modellnummer" for å avsløre den skjulte "A"-nummeret: en "A" etterfulgt av fire sifre. Skriv det inn i feltet nedenfor."',
    fa: '"آیپد شما. ما به جزئیات مدل آن نیاز داریم. به تنظیمات بروید> عمومی> درباره. نام مدل را در زیر وارد کنید. سپس روی "شماره مدل" کلیک کنید تا شماره "A" پنهان شده را نشان دهد: یک "A" دنبال شده از چهار رقم. آن را در زیر وارد کنید."',
    pl: 'Loading...',
    pt: '"SEU iPad. Precisamos de detalhes especificando o modelo. Vá para Configurações > Geral > Sobre. Copie o "Nome do Modelo" para o campo abaixo. Em seguida, toque no "Número do Modelo" para revelar o número "A" oculto: um "A" seguido de quatro dígitos. Digite isso no campo abaixo."',
    ro: 'Loading...',
