    nl: 'Loading...',
    'en-UK': 'Loading...',
    fi: 'Loading...',
    fr: "VOTRE ordinateur Macintosh. Nous avons besoin de détails spécifiant son modèle. Tout en appuyant sur la touche Option, rendez-vous dans le menu Pomme  > Informations Système. Depuis l'aperçu du matériel, copiez le Nom du modèle et l'Identifiant du modèle dans les champs correspondants ci-dessous.",
