    el: 'Loading...',
    he: 'המחשב שלך Macintosh. אנחנו זקוקים לפרטים המפרטים את הדגם שלו. בעת לחיצה על מקש האפשרות, עבור לתפריט התפריט  > מידע מערכת. מתוך הסקירה החומרה, העתק את שם הדגם ומזהה הדגם לשדות המתאימים למטה.',
    hi: 'Loading...',
    hu: 'Loading...',
