    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'JŪSŲ Macintosh KOMPIUTERIS. Mums reikia informacijos, nurodančios jo modelį. Paspauskite Option klavišą ir eikite į Apple meniu  > System Information. Iš Hardware Overview nukopijuokite Model Name ir Model Identifier į atitinkamus laukus žemiau.',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'DIN Macintosh DATAMASKIN. Vi trenger detaljer som spesifiserer modellen. Mens du trykker på Alternativ-tasten, gå til Apple-menyen  > Systeminformasjon. Fra maskinvareoversikten, kopier modellnavnet og modellidentifikatoren til de tilsvarende feltene nedenfor.',
    fa: '«کامپیوتر Macintosh شما. ما نیاز به جزئیاتی در مورد مدل آن داریم. در حالی که کلید Option را فشار داده، به منوی Apple  > System Information بروید. از بخش Hardware Overview، نام مدل و شناسه مدل را در فیلدهای مربوطه زیر کپی کنید.»',
    pl: 'TWÓJ komputer Macintosh. Potrzebujemy szczegółów dotyczących jego modelu. Przytrzymując klawisz Option, przejdź do menu Apple  > Informacje o systemie. Skopiuj nazwę modelu i identyfikator modelu z zakładki Przegląd sprzętu do odpowiednich pól poniżej.',
    pt: 'SEU COMPUTADOR Macintosh. Precisamos de detalhes especificando o modelo. Enquanto pressiona a tecla Option, vá para o menu Apple  > Informações do Sistema. A partir da Visão Geral do Hardware, copie o Nome do Modelo e o Identificador do Modelo para os campos correspondentes abaixo.',
    ro: 'COMPUTERUL tău Macintosh. Avem nevoie de detalii care să specifice modelul acestuia. În timp ce apeși tasta Option, mergi la meniul Apple  > Informații sistem. Din secțiunea Privire de ansamblu hardware, copiază Numele modelului și Identificatorul modelului în câmpurile corespunzătoare de mai jos.',
