    hi: 'आपका Windows कंप्यूटर। हमें इसके ब्रांड और मॉडल के बारे में विवरण चाहिए। स्टार्ट खोलें। सिस्टम जानकारी खोजें और ऐप खोलने के लिए शीर्ष परिणाम पर क्लिक करें।\nसिस्टम सारांश पर क्लिक करें।\n"सिस्टम मॉडल" फ़ील्ड के नीचे देखें।\nमॉडल नाम और नंबर को नीचे के संबंधित फ़ील्ड में कॉपी करें।',
    hu: 'Loading...',
    is: 'Loading...',
    id: '"KOMPUTER Windows ANDA. Kami memerlukan rincian yang menyebutkan merek dan modelnya. Buka Start. Cari Informasi Sistem dan klik hasil teratas untuk membuka aplikasinya.\nKlik pada Ringkasan Sistem.\nLihat di bawah kolom "Model Sistem".\nSalin Nama dan Nomor Model ke kolom yang sesuai di bawah ini."',
    it: '\nIL TUO computer Windows. Abbiamo bisogno di dettagli che specificano la marca e il modello. Apri Start. Cerca Informazioni Sistema e clicca sul primo risultato per aprire l\'app.\nClicca su Riepilogo Sistema.\nGuarda sotto il campo "Modello Sistema".\nCopia il Nome e il Numero del Modello nei campi corrispondenti qui sotto.',
    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'KOMPUTER Windows ANDA. Kami memerlukan butiran yang menentukan jenama dan modelnya. Buka Mula. Cari Maklumat Sistem dan klik hasil teratas untuk membuka aplikasi.\nKlik pada Ringkasan Sistem.\nLihat di bawah bidang "Model Sistem".\nSalin Nama dan Nombor Model ke bidang yang berkaitan di bawah.',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: '"SEU COMPUTADOR Windows. Precisamos de detalhes especificando sua marca e modelo. Abra o Iniciar. Pesquise por Informações do Sistema e clique no resultado principal para abrir o aplicativo.\nClique em Resumo do Sistema.\nProcure pelo campo "Modelo do Sistema".\nCopie o Nome e Número do Modelo para os campos correspondentes abaixo."',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: '\nTU COMPUTADORA Windows. Necesitamos detalles que especifiquen su marca y modelo. Abre Inicio. Busca Información del Sistema y haz clic en el primer resultado para abrir la aplicación.\nHaz clic en Resumen del Sistema.\nMira bajo el campo "Modelo del Sistema".\nCopia el Nombre y Número del Modelo en los campos correspondientes abajo.',
    su: 'Loading...',
    sw: 'Loading...',
    sv: 'Loading...',
    tl: '"ANG iyong Windows COMPUTER. Kailangan namin ng mga detalye na nagtatakda ng tatak at modelo nito. Buksan ang Start. Maghanap ng Impormasyon sa System at i-click ang nangungunang resulta upang buksan ang app.\nI-click ang System Summary.\nTingnan sa ilalim ng patlang na "System Model".\nKopyahin ang Pangalan at Numero ng Modelo sa mga katumbas na patlang sa ibaba."',
    tr: 'Loading...',
    ur: 'آپ کے ونڈوز کمپیوٹر۔ ہمیں اس کی برانڈ اور ماڈل کی تفصیلات کی ضرورت ہے۔ شروع کریں۔ سسٹم انفارمیشن تلاش کریں اور ایپ کو کھولنے کے لئے اوپری نتیجہ پر کلک کریں۔\nسسٹم خلاصہ پر کلک کریں۔\n"سسٹم ماڈل" فیلڈ کے نیچے دیکھیں۔\nماڈل نام اور نمبر کو مطابقتی فیلڈز میں کاپی کریں۔',
