    hi: 'इस अध्ययन के लिए वेबकैम का उपयोग करना आवश्यक है। आपके वेबकैम का पहुंच देना वैकल्पिक है, लेकिन हम इसके बिना आगे नहीं बढ़ सकते। यदि आपने गलती से नहीं कहा है और अब हमें अपने कैमरे का पहुंच देना चाहते हैं, तो कृपया पता पट्टी में कैमरा आइकन ढूंढें, उसे क्लिक करें, कैमरा पहुंच को अनुमति दें और पेज को ताजगी दें।',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: "Questo studio richiede l'uso della webcam. Concedere l'accesso alla tua webcam è facoltativo, ma non possiamo proseguire senza di essa. Se hai detto No per errore e ora desideri darci accesso alla tua fotocamera, cerca l'icona della fotocamera nella barra degli indirizzi, cliccala, permetti l'accesso alla fotocamera e aggiorna la pagina.",
    ja: '「この研究ではウェブカメラを使用する必要があります。ウェブカメラへのアクセスを許可することは任意ですが、それなしでは続行できません。もし間違って「いいえ」と答えてしまい、今後カメラへのアクセスを許可したい場合は、アドレスバーにあるカメラのアイコンを見つけ、クリックしてカメラへのアクセスを許可し、ページを更新してください。」',
    kn: 'Loading...',
