    lt: 'Loading...',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '"این مطالعه نیاز به استفاده از وبکم دارد. اجازه دسترسی به وبکم شما اختیاری است، اما بدون آن نمی‌توانیم ادامه دهیم. اگر به اشتباه "خیر" را انتخاب کرده‌اید و می‌خواهید به ما دسترسی به دوربین خود را بدهید، لطفاً آیکون دوربین را در نوار آدرس پیدا کنید، بر روی آن کلیک کنید، دسترسی دوربین را مجاز کنید و صفحه را تازه کنید."',
