    hr: 'Loading...',
    cs: 'CHYŤ KŘÍŽEK! Potřebujeme tvou pomoc. Sledovač očí potřebuje více tréninku. Jak ukazuje šipka, když jsi klikl, sledovač si myslel, že tvůj pohled je daleko od křížku. Prosím, klikni na křížek na každé nové pozici. Je to hra. Chyť křížek!',
    da: 'Loading...',
    nl: 'Loading...',
    'en-UK':
      "CATCH THE CROSS! We need your help. The eye tracker needs more training. As shown by the arrow, when you clicked, the tracker thought your gaze was far from the cross hairs. Please click the cross hairs at each new position. It's a game. Catch the cross!",
    fi: 'NAPPA KIINNI RISTI! Tarvitsemme apuasi. Silmänseurantalaite tarvitsee lisää koulutusta. Kuten nuolesta näkyy, kun napsautit, seuranta ajatteli katseesi olevan kaukana ristikosta. Napsauta ristiä jokaisessa uudessa sijainnissa. Se on peli. Nappaa risti!',
    fr: "ATTRAPEZ LA CROIX ! Nous avons besoin de votre aide. Le suivi oculaire nécessite plus d'entraînement. Comme l'indique la flèche, lorsque vous avez cliqué, le suivi pensait que votre regard était loin de la croix. Veuillez cliquer sur la croix à chaque nouvelle position. C'est un jeu. Attrapez la croix !",
    de: 'Loading...',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Fogd el a keresztet! Szükségünk van a segítségedre. Az eye trackernek több edzésre van szüksége. Ahogy a nyíl mutatja, amikor rákattintottál, a tracker úgy gondolta, hogy a tekinteted messze van a kereszttől. Kérlek, kattints a keresztre minden új pozícióban. Ez egy játék. Fogd el a keresztet!',
    is: 'PENANGKAPAN SALIB! Kami membutuhkan bantuanmu. Eye tracker membutuhkan pelatihan lebih lanjut. Seperti yang ditunjukkan oleh panah, ketika kamu mengklik, tracker mengira pandanganmu jauh dari garis salib. Silakan klik garis salib pada setiap posisi baru. Ini adalah permainan. Tangkap salib!',
    id: 'Loading...',
    it: 'ACCHIAPPA LA CROCE! Abbiamo bisogno del tuo aiuto. Il tracciamento oculare necessita di ulteriore allenamento. Come indicato dalla freccia, quando hai cliccato, il tracciamento pensava che il tuo sguardo fosse lontano dalla croce. Per favore, clicca sulla croce ogni volta che cambia posizione. È un gioco. Acchiappa la croce!',
    ja: 'Loading...',
    kn: 'ಕ್ರಾಸ್ ಹಿಡಿಯಿರಿ! ನಮಗೆ ನಿಮ್ಮ ಸಹಾಯ ಬೇಕು. ಕಣ್ಣು ಟ್ರ್ಯಾಕರ್ ಹೆಚ್ಚು ತರಬೇತಿ ಅಗತ್ಯವಿದೆ. ಬಾಣದಿಂದ ತೋರಿಸಲಾದ ರೀತಿಯಂತೆ, ನೀವು ಕ್ಲಿಕ್ ಮಾಡಿದಾಗ, ಟ್ರ್ಯಾಕರ್ ನಿಮ್ಮ ದೃಷ್ಟಿಯನ್ನು ಕ್ರಾಸ್ ಹೇರುಗಳಿಂದ ದೂರವಾಗಿ ಭಾವಿಸಿತು. ಹೊಸ ಸ್ಥಾನದಲ್ಲಿ ಪ್ರತಿ ಬಾರಿ ಕ್ರಾಸ್ ಹೇರುಗಳನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ. ಇದು ಒಂದು ಆಟ. ಕ್ರಾಸ್ ಹಿಡಿಯಿರಿ!',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'چشم بر روی صلیب بگیر! به کمک شما نیاز داریم. ردیاب چشم نیاز به آموزش بیشتر دارد. همانطور که با پیکان نشان داده شده است، وقتی شما کلیک کردید، ردیاب فکر کرد که نگاه شما از صلیب دور است. لطفا در هر موقعیت جدید روی صلیب کلیک کنید. این یک بازی است. صلیب را بگیرید!',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'ЛОВИТЕ КРЕСТ! Нам нужна ваша помощь. Трекер глаз нуждается в дополнительной тренировке. Как показано стрелкой, когда вы нажали, трекер подумал, что ваш взгляд был далеко от перекрестия. Пожалуйста, нажимайте на перекрестие в каждом новом положении. Это игра. Лови крест!',
    sr: 'Loading...',
    es: '¡ATRAPA LA CRUZ! Necesitamos tu ayuda. El rastreador de mirada necesita más entrenamiento. Como muestra la flecha, cuando hiciste clic, el rastreador pensó que tu mirada estaba lejos de la cruz. Por favor, haz clic en la cruz en cada nueva posición. Es un juego. ¡Atrapa la cruz!',
