    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: 'Participar en este estudio te permite hacer una contribución significativa al avance de la investigación auditiva en línea proporcionando datos esenciales sobre la amplia gama de micrófonos de smartphones y altavoces de computadoras. Esta investigación tiene como objetivo crear una biblioteca detallada de perfiles de dispositivos que mejorará la precisión de las pruebas auditivas realizadas en línea. El esquema depende de la coincidencia del micrófono del teléfono del usuario con un micrófono calibrado en laboratorio. Cada modelo tiene un micrófono diferente, por lo que es crucial especificar el modelo.\n\nEntendiendo que la privacidad es una prioridad, por favor ten la seguridad de que esta encuesta solo retiene los números de modelo de los teléfonos y computadoras. Estos números de modelo no están vinculados a ninguna información personal y no pueden ser utilizados para identificarte individualmente.',
