    de: '❌ INKOMPATIBEL. Entschuldigung. Sie können gerne einen anderen Browser, Computer oder was auch immer kompatibel sein könnte, ausprobieren. Andernfalls klicken Sie auf ABBRECHEN, um diese Studie an Prolific.com zurückzugeben.',
    el: '❌ ΑΣΥΜΒΑΤΟ. Λυπούμαστε. Μπορείτε να δοκιμάσετε έναν άλλο περιηγητή ιστού ή υπολογιστή ή οτιδήποτε άλλο που μπορεί να είναι συμβατό. Διαφορετικά, πατήστε ΑΚΥΡΟ για να επιστρέψετε αυτήν τη μελέτη στο Prolific.com.',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: '❌ TIDAK COMPATIBLE. Maaf. Anda dapat mencoba menggunakan browser, komputer, atau apa pun yang mungkin compatible. Jika tidak, klik CANCEL untuk kembali ke studi ini di Prolific.com.',
    it: '❌ INCOMPATIBILE. Spiacente. Sei libero di provare un altro browser, un altro computer o qualsiasi cosa possa essere compatibile. Altrimenti premi ANNULLA per restituire questo studio a Prolific.com.',
    ja: '❌ 互換性がありません。申し訳ありません。他のブラウザやコンピュータ、または互換性のあるものを試してみてください。それ以外の場合は、この調査をProlific.comに戻すためにキャンセルを押してください。',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'Loading...',
    ml: 'Loading...',
    no: '❌ INKOMPATIBELT. Beklager. Du kan prøve en annen nettleser, eller datamaskin, eller hva som helst som kan være kompatibelt. Ellers trykk AVBRYT for å returnere denne studien til Prolific.com.',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: '❌ NEKOMPATIBILNO. Izvinjavamo se. Možete pokušati sa drugim pretraživačem, ili računarom, ili bilo čim što bi moglo biti kompatibilno. U suprotnom, pritisnite OTKAŽI da biste vratili ovu studiju na Prolific.com.',
    es: '\n❌ INCOMPATIBLE. Lo siento. Eres libre de probar con otro navegador, computadora, o cualquier cosa que pueda ser compatible. De lo contrario, presiona CANCELAR para devolver este estudio a Prolific.com.',
    su: 'Loading...',
    sw: '❌ HAIWEZEKANI. Samahani. Unaweza kujaribu kivinjari kingine, au kompyuta, au kitu kingine kinachoweza kuwa sawa. Vinginevyo bonyeza KUFUTA ili kurudisha utafiti huu kwa Prolific.com.',
    sv: 'Loading...',
    tl: '❌ HINDI COMPATIBLE. Pasensya na. Puwede kang subukan ang ibang browser, o computer, o kahit ano na maaaring compatible. Kung hindi, pindutin ang KANSELA para ibalik ang pag-aaral na ito sa Prolific.com.',
    tr: "❌ UYUŞMAZLIK. Üzgünüz. Başka bir tarayıcı, bilgisayar veya uyumlu olabilecek herhangi bir şeyi denemek için hoş geldiniz. Aksi takdirde, bu çalışmayı Prolific.com'a geri dönmek için İPTAL'e basın.",
