    cs: '0. ZABRAŇTE SPÁNKU. Telefon nesmí během kalibrace usnout. Pokud je baterie téměř vybitá, připojte ji k nabíječce. Pokud je potřeba: Zvýšte dobu spánku na nejméně 5 minut. Na iPhonu přejděte do Nastavení: Zobrazení: Jas: Automatické zamykání. Na Androidu přejděte do Nastavení: Zobrazení: Časový limit obrazovky.\n1. VYHNĚTE SE PŘERUŠENÍ. Pokud je to možné, vypněte upozornění. Pokud je kalibrace přerušena, například příchozím hovorem, stiskněte tlačítko "Znovu nahrát" pro začátek znovu.\n2. UDĚLTE SOUHLAS. Pokud se objeví vyskakovací okno s žádostí o povolení použití mikrofonu, klikněte na "Povolit".\n3. POLOŽTE TELEFON NA VYSOKOU SKLENICI NA PITÍ (nebo kávovou šálek nebo plechovku s limonádou/pivem), mezi vámi a klávesnicí, s mikrofonem (dolním) okrajem směřujícím k počítači. Reproduktory notebooku jsou v klávesnici; umístěte telefon tak, aby jeho mikrofon byl ve vašem zorném poli na klávesnici. Reproduktory stolního počítače jsou za mřížkou; namířte telefon na mřížku.\n4. POKRAČUJTE. Stiskněte tlačítko "Pokračovat".\n',
