    fr: '\n0. ÉVITER LA MISE EN VEILLE. Le téléphone ne doit pas se mettre en veille pendant la calibration. Si la batterie est faible, branchez-le. Si nécessaire : Augmentez le temps avant mise en veille à au moins 5 minutes. Sur iPhone, allez dans Réglages : Affichage : Luminosité : Verrouillage automatique. Sur Android, allez dans Réglages : Affichage : Délai d\'extinction de l\'écran.\n1. ÉVITER LES INTERRUPTIONS. Si possible, désactivez les alertes. Si la calibration est interrompue, par exemple par un appel entrant, appuyez sur le bouton "Re-Enregistrer" pour recommencer.\n2. ACCORDER LA PERMISSION. Si une fenêtre pop-up demande la permission d\'utiliser le microphone, cliquez sur "Autoriser".\n3. POSER LE TÉLÉPHONE SUR UN GRAND VERRE (ou une tasse de café ou une canette de soda/bière), entre vous et votre clavier, avec le bord du microphone (en bas) orienté vers votre ordinateur. Les haut-parleurs des ordinateurs portables sont dans le clavier ; placez votre téléphone de sorte que son microphone soit aligné avec votre ligne de vue vers le clavier. Les haut-parleurs des ordinateurs de bureau sont derrière une grille ; orientez votre téléphone vers la grille.\n4. PROCÉDER. Appuyez sur "Procéder".\n',
