    'en-US':
      'ASSURANCE OF CAMERA PRIVACY. No photos or video are recorded. Each webcam frame is used only inside this computer, solely to estimate eye and gaze positions, and then erased, within 10 seconds. Only the eye and gaze positions are retained.',
    ar: 'تأكيد خصوصية الكاميرا. لا يتم تسجيل أي صور أو فيديوهات. يُستخدم كل إطار من إطارات كاميرا الويب داخل هذا الكمبيوتر فقط، وذلك لتقدير مواقع العين والنظر فقط، ثم يتم مسحها خلال 10 ثوانٍ. فقط مواقع العين والنظر هي التي يتم الاحتفاظ بها.',
    hy: 'Loading...',
    bg: 'Loading...',
    'zh-CN': 'Loading...',
    'zh-HK':
      '攝像機隱私保證。不會記錄任何照片或視頻。每個網絡攝像頭畫面僅在此電腦內使用，僅用於估計眼睛和凝視位置，然後在10秒內被刪除。只有眼睛和凝視位置被保留。',
    hr: 'JAMSTVO PRIVATNOSTI KAMERE. Nema snimanja fotografija ili videozapisa. Svaki okvir web kamere koristi se samo unutar ovog računala, isključivo za procjenu položaja oka i pogleda, a zatim se briše u roku od 10 sekundi. Samo položaji oka i pogleda se zadržavaju.',
    cs: 'Loading...',
    da: 'Loading...',
    nl: 'Loading...',
    'en-UK': 'Loading...',
    fi: 'Loading...',
    fr: "ASSURANCE DE LA CONFIDENTIALITÉ DE LA CAMÉRA. Aucune photo ni vidéo n'est enregistrée. Chaque image de la webcam est utilisée uniquement sur cet ordinateur, exclusivement pour estimer les positions des yeux et du regard, puis effacée, dans un délai de 10 secondes. Seules les positions des yeux et du regard sont conservées.",
    de: 'Loading...',
    el: 'ΕΓΓΥΗΣΗ ΙΔΙΩΤΙΚΟΤΗΤΑΣ ΤΗΣ ΚΑΜΕΡΑΣ. Δεν καταγράφονται φωτογραφίες ή βίντεο. Κάθε καρέ της webcam χρησιμοποιείται μόνο μέσα σε αυτόν τον υπολογιστή, αποκλειστικά για την εκτίμηση της θέσης των ματιών και της κατεύθυνσης του βλέμματος και στη συνέχεια διαγράφεται, εντός 10 δευτερολέπτων. Μόνο οι θέσεις των ματιών και του βλέμματος διατηρούνται.',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: "ASSICURAZIONE DELLA PRIVACY DELLA TELECAMERA. Non vengono registrate foto o video. Ogni fotogramma della webcam viene utilizzato solo all'interno di questo computer, esclusivamente per stimare la posizione degli occhi e dello sguardo, e poi cancellato, entro 10 secondi. Vengono conservate solo le posizioni degli occhi e dello sguardo.",
    ja: 'Loading...',
    kn: 'ಕ್ಯಾಮೆರಾ ಗೌಪ್ಯತೆಯ ದೃಢೀಕರಣ. ಯಾವುದೇ ಫೋಟೋಗಳು ಅಥವಾ ವೀಡಿಯೊಗಳು ರೆಕಾರ್ಡ್ ಆಗುವುದಿಲ್ಲ. ಪ್ರತಿ ವೆಬ್ಕ್ಯಾಮ್ ಫ್ರೇಮ್ ಕೇವಲ ಕಣ್ಣು ಮತ್ತು ದೃಷ್ಟಿ ಸ್ಥಾನಗಳನ್ನು ಅಂಕಿತಗೊಳಿಸಲು ಮಾತ್ರ ಬಳಸಲಾಗುತ್ತದೆ ಮತ್ತು ನಂತರ 10 ಸೆಕೆಂಡ್ಗಳಲ್ಲಿ ಅದು ಮಾಯವಾಗುತ್ತದೆ. ಕೇವಲ ಕಣ್ಣು ಮತ್ತು ದೃಷ್ಟಿ ಸ್ಥಾನಗಳು ಉಳಿದುಕೊಳ್ಳುತ್ತವೆ.',
    ko: '카메라 개인 정보 보호 보장. 사진이나 동영상은 기록되지 않습니다. 각 웹캠 프레임은 이 컴퓨터 내에서만 사용되며, 눈과 시선 위치를 추정한 후 10초 이내에 삭제됩니다. 눈과 시선 위치만 보존됩니다.',
    lt: 'Loading...',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'تضمین حریم خصوصی دوربین. هیچ عکس یا ویدیویی ضبط نمی شود. هر فریم وب کم فقط در داخل این کامپیوتر استفاده می شود، صرفاً برای تخمین موقعیت چشم و نگاه، و سپس در عرض 10 ثانیه پاک می شود. تنها موقعیت چشم و نگاه نگه داشته می شود.',
    pl: 'GWARANCJA PRYWATNOŚCI KAMERY. Żadne zdjęcia ani nagrania wideo nie są rejestrowane. Każda klatka z kamery jest używana tylko wewnątrz tego komputera, wyłącznie do oszacowania pozycji oka i spojrzenia, a następnie jest usuwana w ciągu 10 sekund. Zachowywane są tylko pozycje oka i spojrzenia.',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: 'ASEGURAMIENTO DE LA PRIVACIDAD DE LA CÁMARA. No se graban fotos ni videos. Cada fotograma de la webcam se utiliza únicamente dentro de este ordenador, solo para estimar las posiciones de los ojos y la mirada, y luego se borra, en un plazo de 10 segundos. Solo se retienen las posiciones de los ojos y la mirada.',
    su: 'Loading...',
    sw: 'HAKI YA FARAGHA YA KAMERA. Hakuna picha au video zinazorekodiwa. Kila fremu ya wavuti inatumika tu ndani ya kompyuta hii, kwa lengo la kutathmini nafasi za macho na mawazo, na kisha kufutwa, ndani ya sekunde 10. Nafasi za macho na mawazo pekee ndizo zinazohifadhiwa.',
    sv: 'Loading...',
    tl: 'KATATAGAN NG PRIVASYA NG CAMERA. Walang mga larawan o video ang nairekord. Ang bawat frame ng webcam ay ginagamit lamang sa loob ng computer na ito, upang tantiyahin ang posisyon ng mata at tingin, at pagkatapos ay binubura, sa loob ng 10 segundo. Tanging ang posisyon ng mata at tingin ang itinatago.',
    tr: 'Loading...',
