    ml: 'Loading...',
    no: 'Loading...',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: '1. VOLUMEN MÁXIMO. Para una calibración precisa del sonido, por favor maximiza el volumen de tu computadora ahora, antes de la calibración, y luego no toques el volumen hasta el final del experimento.\n2. SIN AURICULARES. Retira y desconecta cualquier auricular. Esta calibración no funcionará con auriculares.',
