    cs: 'Je to vzácné, ale pokud se váš počítač zasekne při kalibraci, stiskněte tlačítko EXIT a vraťte tuto studii na Prolific.com.',
    da: 'Det er sjældent, men hvis din computer sætter sig fast i kalibrering, skal du trykke på EXIT for at returnere denne undersøgelse til Prolific.com. ',
    nl: 'Het is zeldzaam, maar als je computer vastloopt tijdens de kalibratie, druk dan op EXIT om deze studie terug te sturen naar Prolific.com.',
    'en-UK':
      "It's uncommon, but if your computer gets stuck in calibration, please press EXIT to return this study to Prolific.com.",
    fi: 'Se on harvinaista, mutta jos tietokoneesi juuttuu kalibrointiin, paina EXIT palauttaaksesi tämän tutkimuksen Prolific.com-sivustolle. ',
    fr: "C'est rare, mais si votre ordinateur reste bloqué en calibration, veuillez appuyer sur EXIT pour renvoyer cette étude à Prolific.com.",
    de: 'Es kommt selten vor, aber wenn Ihr Computer bei der Kalibrierung hängen bleibt, klicken Sie bitte auf BEENDEN, um diese Studie an Prolific.com zurückzugeben. ',
    el: 'Είναι σπάνιο, αλλά εάν ο υπολογιστής σας κολλήσει στη βαθμονόμηση, πατήστε EXIT για να επιστρέψετε αυτήν τη μελέτη στο Prolific.com. ',
    he: 'זה נדיר, אבל אם המחשב שלך נתקע בכיול, אנא הקש על EXIT כדי להחזיר את המחקר הזה ל-Prolific.com. ',
    hi: 'यह दुर्लभ होता है, लेकिन अगर आपका कंप्यूटर कैलिब्रेशन में फंस जाता है, तो कृपया Prolific.com पर इस अध्ययन को वापस लौटने के लिए EXIT दबाएं।',
    hu: 'Ritka, de ha számítógépe elakad a kalibrálás közben, nyomja meg az EXIT gombot, hogy visszaküldje ezt a tanulmányt a Prolific.com webhelyre. ',
    is: 'Það er sjaldgæft, en ef tölvan þín festist í kvörðun, vinsamlegast ýttu á EXIT til að skila þessari rannsókn á Prolific.com. ',
    id: 'Ini jarang terjadi, namun jika komputer Anda macet saat kalibrasi, silakan tekan EXIT untuk mengembalikan studi ini ke Prolific.com. ',
    it: 'È raro, ma se il tuo computer si blocca durante la calibrazione, premi ESCI per ritornare a questo studio su Prolific.com.',
    ja: 'まれですが、コンピューターが調整中にスタックした場合は、「終了」を押してこの調査結果を Prolific.com に戻してください。 ',
    kn: 'ಇದು ಅಪರೂಪ, ಆದರೆ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ಮಾಪನಾಂಕ ನಿರ್ಣಯದಲ್ಲಿ ಸಿಲುಕಿಕೊಂಡರೆ, ಈ ಅಧ್ಯಯನವನ್ನು Prolific.com ಗೆ ಹಿಂತಿರುಗಿಸಲು ದಯವಿಟ್ಟು EXIT ಒತ್ತಿರಿ. ',
    ko: '드문 경우이지만 컴퓨터가 보정 중에 멈춘 경우 EXIT를 눌러 이 연구를 Prolific.com에 반환하십시오. ',
    lt: 'Tai reta, bet jei jūsų kompiuteris įstringa kalibruojant, paspauskite EXIT, kad grąžintumėte šį tyrimą į Prolific.com. ',
    ms: 'Ia jarang berlaku, tetapi jika komputer anda tersekat dalam penentukuran, sila tekan EXIT untuk mengembalikan kajian ini kepada Prolific.com. ',
    ml: 'ഇത് അപൂർവമാണ്, എന്നാൽ നിങ്ങളുടെ കമ്പ്യൂട്ടർ കാലിബ്രേഷനിൽ കുടുങ്ങിയാൽ, ഈ പഠനം Prolific.com-ലേക്ക് തിരികെ നൽകാൻ EXIT അമർത്തുക. ',
    no: 'Det er sjeldent, men hvis datamaskinen din blir sittende fast i kalibrering, trykk EXIT for å returnere denne studien til Prolific.com. ',
    fa: 'نادر است، اما اگر رایانه شما در کالیبراسیون گیر کرد، لطفاً EXIT را فشار دهید تا این مطالعه به Prolific.com برگردد. ',
    pl: 'Jest to rzadkie, ale jeśli Twój komputer utknie w kalibracji, naciśnij EXIT, aby zwrócić to badanie do Prolific.com. ',
    pt: 'É raro, mas se o seu computador travar na calibração, clique em EXIT para retornar este estudo ao Prolific.com. ',
    ro: 'Este rar, dar dacă computerul rămâne blocat în calibrare, apăsați pe EXIT pentru a returna acest studiu la Prolific.com. ',
    ru: 'Это редкость, но если ваш компьютер застрял на калибровке, пожалуйста, нажмите ВЫХОД, чтобы вернуться к этому исследованию на Prolific.com.',
    sr: 'Retko se dešava, ali ako vaš računar zapne prilikom kalibracije, molimo pritisnite IZLAZ da biste vratili ovu studiju na Prolific.com.',
    es: 'Es raro, pero si tu computadora se queda atascada en la calibración, por favor presiona SALIR para regresar a este estudio en Prolific.com.',
    su: 'Jarang, tapi upami komputer anjeun macét dina kalibrasi, mangga pencét EXIT pikeun mulangkeun ulikan ieu ka Prolific.com. ',
    sw: 'Inatokea mara chache, lakini ikiwa kompyuta yako inakwama katika kalibishi, tafadhali bonyeza EXIT kurudisha utafiti huu kwa Prolific.com.',
    sv: 'Det är sällsynt, men om din dator fastnar i kalibreringen, vänligen tryck på EXIT för att returnera denna studie till Prolific.com. ',
    tl: 'Ito ay bihira, ngunit kung ang iyong computer ay natigil sa pagkakalibrate, mangyaring pindutin ang EXIT upang ibalik ang pag-aaral na ito sa Prolific.com. ',
    tr: "Nadir görülen bir durumdur, ancak bilgisayarınız kalibrasyonda takılıp kalırsa lütfen bu çalışmayı Prolific.com'a geri göndermek için EXIT'e basın. ",
    ur: 'یہ کمزوری ہوتی ہے، لیکن اگر آپ کا کمپیوٹر کیلیبریشن میں پھنس جاتا ہے تو براہ کرم EXIT دبائیں تاکہ یہ مطالعہ Prolific.com پر واپس لوٹ سکے۔',
