    hi: 'अधिकतम वॉल्यूम। कोई हेडफोन नहीं। सही ध्वनि समायोजन के लिए, कृपया कैलिब्रेशन से पहले अपने कंप्यूटर की ध्वनि वॉल्यूम को अधिक करें, और फिर अंत तक वॉल्यूम को छूने की कोशिश न करें।\nक्यूआर लिंक प्राप्त करने के लिए उपयोगकर्ता कैमरा का उपयोग करें। जब नीचे क्यूआर कोड दिखाई देता है, तो अपने स्मार्टफोन कैमरा को इस पर देखाएं, और अपने स्मार्टफोन स्क्रीन पर दिखाई देने वाले लिंक पर क्लिक करें। फिर स्मार्टफोन स्क्रीन पर दिए गए निर्देशों का पालन करें।\n——————————————————————————————————————————\nकृपया शांति! अब रिकॉर्डिंग हो रही है। वॉल्यूम नियंत्रण को छूने की कोशिश न करें।\n——————————————————————————————————————————\nसमस्या?\n1. आपके लैपटॉप पर चल रहे EasyEyes की मुख्य वेब पेज ने आपके स्मार्टफोन पर QR-लिंक वाले वेब पेज से बात करने के लिए webRTC प्रोटोकॉल का उपयोग किया है। यह प्रोटोकॉल कनेक्ट करने के कई तरीकों में से सबसे अच्छा तब होता है जब आपका फोन और कंप्यूटर दोनों एक ही WiFi नेटवर्क पर हों।\n2. अगर आपका स्मार्टफोन कनेक्शन में त्रुटि रिपोर्ट करता है, तो कोशिश करें कि स्मार्टफोन ब्राउज़र को बंद करके फिर से शुरू करें, या फिर स्मार्टफोन को रीस्टार्ट करें।\n3. यह बहुत कम होता है, लेकिन अगर ध्वनि नहीं बजती है, या बाद में बजती है, लेकिन कोई प्रोसीड बटन नहीं दिखाई देता है, तो इसका मतलब है कि कैलिब्रेशन विफल हो गया है। आप इस ब्राउज़र पेज को रिफ्रेश करके फिर से कोशिश कर सकते हैं। आमतौर पर यह काम कर जाता है।',
    hu: 'Loading...',
