    id: 'Loading...',
    it: "VOLUME MASSIMO. SENZA CUFFIE. Per una calibrazione del suono accurata, per favore massimizza il volume del suono del tuo computer ora, prima della calibrazione, e poi non toccare il volume fino alla fine dell'esperimento.\nUSA LA FOTOCAMERA PER OTTENERE IL LINK QR. Quando il codice QR appare qui sotto, punta la fotocamera del tuo smartphone verso di esso e clicca sul link che appare sullo schermo del tuo smartphone. Poi segui le istruzioni sullo schermo dello smartphone.\n——————————————————————————————————————————\nSILENZIO PER FAVORE! REGISTRAZIONE IN CORSO. NON TOCCARE IL CONTROLLO DEL VOLUME.\n——————————————————————————————————————————\nPROBLEMI?\n1. La pagina web principale che esegue EasyEyes sul tuo laptop utilizza il protocollo webRTC per comunicare con la pagina web collegata al QR sul tuo smartphone. Questo protocollo cerca il migliore tra diversi modi per connettersi. Il migliore è quando il tuo telefono e il computer sono entrambi sulla stessa rete WiFi.\n\n2. Se il tuo smartphone segnala un errore nella connessione, prova a chiudere e riaprire il browser dello smartphone, o anche a riavviare lo smartphone.\n\n3. È raro, ma se il suono non viene riprodotto, o, dopo che è stato riprodotto, non appare il pulsante Procedi, significa che la calibrazione è fallita. Puoi provare di nuovo aggiornando questa pagina del browser. Di solito, questo risolve il problema.",
    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'MAKSIMALUS GARSO LYGIS. Nenaudokite ausinių. Norint gauti tikslų garso kalibravimą, dabar, prieš kalibravimą, padidinkite savo kompiuterio garso lygį iki maksimumo ir tada nelieskite garso kol eksperimentas baigsis.\nNAUDOKITE KAMERĄ, KAD GAUTUMĖTE QR NUORODĄ. Kai žemiau atsiras QR kodas, nukreipkite savo išmanųjį telefono kamerą į jį ir spustelėkite nuorodą, kuri atsiras jūsų išmaniuoju telefono ekrane. Tada sekitės instrukcijas išmaniuoju telefono ekrane.\n——————————————————————————————————————————\nPRAŠOME TYLOS! DABAR VYKDOMAS ĮRAŠAS. NESIDOTINKITE GARSO VALDYMO.\n——————————————————————————————————————————\nPROBLEMA?\n1. Pagrindinė EasyEyes veikianti tinklalapio versija jūsų nešiojamajame kompiuteryje naudoja webRTC protokolą, kad bendrautų su QR nuorodą turinčiu tinklalapiu jūsų išmaniuoju telefone. Šis protokolas ieško geriausio būdo prisijungti. Geriausias būdas yra, kai jūsų telefonas ir kompiuteris yra tame pačiame WiFi tinkle.\n2. Jei jūsų išmanusis telefonas praneša apie ryšio klaidą, bandykite išjungti ir paleisti išmaniojo telefono naršyklę ar netgi iš naujo paleisti išmanųjį telefoną.\n3. Tai retai pasitaiko, bet jei garsas negrotų arba po jo grojimo nepasirodytų mygtukas "Tęsti", tai reiškia, kad kalibravimas nepavyko. Galite bandyti dar kartą atnaujindami šį naršyklės puslapį. Tai paprastai padeda.\n',
    ms: 'Loading...',
