    fi: 'Loading...',
    fr: "\n❌ Désolé, les mesures les plus récentes à gauche et à droite étaient incohérentes. Pouvons-nous réessayer ? Gardez un œil fermé. Concentrez-vous sur la croix et surveillez le point clignotant du coin de l'œil. Déplacez le point à gauche et à droite jusqu'à ce qu'il disparaisse dans votre angle mort, puis appuyez sur RETOUR. Maintenez votre distance de visionnement lorsque vous testez les deux yeux.",
