    is: 'Loading...',
    id: 'Loading...',
    it: "È spostato a sinistra. Questo display è statico, quindi sarebbe facile spostare gli occhi sulle linee e riconoscere lo spostamento. Ma, in una prova reale, le linee vengono LAMPEGGIATE, quindi non c'è tempo per muovere gli occhi. È importante guardare la croce mentre si inizia ogni prova. Le linee lampeggeranno immediatamente. Non importa dove vanno i tuoi occhi dopo il lampeggio. Il primo blocco di test è solo qualche prova di pratica, prima di iniziare seriamente.",
