    fr: "C'est un R. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers la lettre et de l'identifier. Mais, dans un vrai essai, les lettres sont CLIGNOTANTES, donc il n'y a pas le temps de déplacer vos yeux. Il est important de regarder la croix lorsque vous démarrez l'essai. Les lettres vont clignoter immédiatement. Peu importe où vos yeux se dirigent après le clignotement. Le premier bloc de tests est juste quelques essais de pratique, avant de commencer sérieusement.",
