    'zh-HK': 'Loading...',
    hr: '"Pozdrav. Provjerite je li zvuk uključen na ovom računalu pritiskom na gumb "Zvučni signal". Usput, čut ćete taj zvučni signal svaki put kad prođete probnu verziju."',
    cs: 'Loading...',
    da: '"Привет. Убедитесь, что на этом компьютере включен звук, нажав кнопку «Звуковой сигнал». Между прочим, вы будете слышать такой звуковой сигнал каждый раз, когда пройдете пробную версию." \n\nПривет. Убедитесь, что на этом компьютере включен звук, нажав кнопку «Звуковой сигнал». Между прочим, вы будете слышать такой звуковой сигнал каждый раз, когда пройдете пробную версию.',
